from collections import defaultdict


def answer_slowest(heights):
	height_dict = defaultdict(list)
	largest_height = 0

	index = 0
	for h in heights:
		if largest_height < h:
			largest_height = h
		height_dict[h].append(index)
		index += 1

	sum_height = 0
	indexes = set()
	for j in range(largest_height, 0, -1):
		indexes |= set(height_dict[j])
		height_dict[j] = list(indexes)
		height_dict[j].sort()
		for i in range(len(height_dict[j])-1):
			sum_height += height_dict[j][i+1] - height_dict[j][i]-1
	return sum_height


def answer_slow(heights):
	ordered_unique_heights = list(set(heights))
	ordered_unique_heights.sort(reverse=True)
	height_dict = defaultdict(list)

	index = 0
	for h in heights:
		height_dict[h].append(index)
		index += 1

	height_sum = 0
	for i in range(len(heights)):
		j = 1
		if i < height_dict[ordered_unique_heights[0]][0]:
			# tallest is to my right
			while height_dict[ordered_unique_heights[j]][0] > i:
				# Search for largest left bound
				j += 1
		elif i > height_dict[ordered_unique_heights[0]][len(height_dict[ordered_unique_heights[0]]) - 1]:
			# tallest is to my left
			while height_dict[ordered_unique_heights[j]][len(height_dict[ordered_unique_heights[j]]) - 1] < i:
				# Search for largest right bound
				j += 1
		else:
			# I am between the tallest
			j = 0

		height_sum += ordered_unique_heights[j] - heights[i]

	return height_sum


def answer(heights):
	largest = 0
	largest_at_smallest_index = 0
	largest_at_biggest_index = 0

	# having an index counter has proved faster than using heights.index(h) for my 9000 item tests
	index = 0
	for h in heights:
		if h > largest:
			largest = h
			largest_at_smallest_index = index
		if h == largest:
			largest_at_biggest_index = index
		index += 1

	height_sum = 0
	largest_so_far = 0
	for i in range(largest_at_smallest_index):
		if heights[i] > largest_so_far:
			largest_so_far = heights[i]
		else:
			height_sum += largest_so_far - heights[i]

	largest_so_far = 0
	for i in range(len(heights) - 1, largest_at_biggest_index, -1):
		if heights[i] > largest_so_far:
			largest_so_far = heights[i]
		else:
			height_sum += largest_so_far - heights[i]

	for i in range(largest_at_smallest_index + 1, largest_at_biggest_index):
		height_sum += largest - heights[i]
	return height_sum


def random_building_heights(howmany, range_limit):
	result = []

	for i in range(howmany):
		result.append(random.randint(1, range_limit))
	return result

